import React from "react";
import "./Piece.css";

class Piece extends React.Component {
	constructor(props) {
		super(props);
		this.number = props.number;
		this.position = props.position;
		this.handleStateChange = props.handleStateChange;
		this.state = {
			position: this.position
		}
	}


	render() {
		let theId = "_" + this.number;
		return (
			<div>
				<div className="piece" draggable="true" onClick={(e) => this.handleStateChange(e)} data-position={this.position} data-number={this.number} id={theId}>
				{this.number}
				</div>
			</div> );

	}
}

export default Piece;
